data:
  - "В такую погоду все равно невозможно что-то делать"
  - "А был в итоге бой Хасбика и Абдурозика? Надо узнать"
  - "Интересно, сколько лайков набирали твои посты Вконтакте в 2016 году? Посмотри!"
  - "На ютубе есть видео, где ежик одновременно чихнул и пукнул"
  - "А что сейчас с радиостанциями, которые все в детстве слушали на даче? Чекни работает ли Эльдорадио сейчас"
  - "Погугли какие есть самые уродливые татухи с младенцами"
  - "Блин, а может тебе в другой город съездить. Посмотри билеты, вдруг есть дешевые"
  - "Посмори видос «Живет в деревне бобер Семен»‎"
  - "Помнишь свои кринжовые старые переписки? Может перечитаешь?"
  - "Пересмотри свои детские фотки, там угар"
  - "Набери Shreck merch на Алике, срочно"
  - "Посмотри видео «Моем грязную пуму»"
  - "Попробуй найти в тиктоке аккаунты про православие... Такие есть"
  - "Сколько стоит купить квратиру на Чукотке? Just asking"
  - "Посмотри как выглядет Валерий Меладзе в молодости"
  - "НАДО В ВАННУ"
  - "Почитай переписки в супер старой беседе класса, точно что-то смешное есть"
  - "Может тебе нужны сухарики «Три Корочки»?"
  - "Смотри, что нашла https://www.youtube.com/watch?v=c1WVwnyfEw4"
  - "А че у Гусейна Гасанова такая ровная борода... А была кривая когда-то? "
  - "Тебе нужны сухарики «Три Корочки»"
  - "Полистай инстаграм  Бритни Спирс"
  - "Сделай любую фразу в генераторе слов и отправь подруге. Интересно что ответит?..."
  - "А если... https://a.aliexpress.com/_ASB22q"
  - "Посмотри как выглядет сейчас девчонки из группы «Ранетки»"
  - "Пересмотри свои странные сохранеки в вк, с тех времен, когда все еще там сидели"
  - "МОРОЖЕНОЕ. Сейчас... JUST SAYING"
  - "Ничего не случится, если ты сейчас пойдешь спать. Ну вроде."
  - "Может быть подстричь челку не такой плохой вариант?"
  - "Интересно, а как со спины выглядит лысина Дмитрия Гордона? Поищи фотки"
  - "В 2016 была игра «Симулятор Козла», может быть ее снова скачать?..."
  - "Перестань работать! Смотри, какую статью нашла https://ru.wikipedia.org/wiki/%D0%AD%D0%BA%D0%B2%D0%B0%D1%82%D0%BE%D1%80_%D0%B1%D0%B5%D0%BB%D1%8B%D1%85_%D1%81%D0%BE%D1%81%D0%B8%D1%81%D0%BE%D0%BA"
